function calc_price(e) {
    if ($.isNumeric(e)) {
        (pro_cost = Math.round(2 * e)) < 50 && (pro_cost = 50),
            (pm_cost = Math.round(2.5 * e)) < 50 && (pm_cost = 50),
            ann_mo_pro_cost = Math.ceil(annualBillMonthly(pro_cost)),
            ann_mo_pm_cost = Math.ceil(annualBillMonthly(pm_cost)),
            pro_bill_ann = Math.ceil(billYearly(ann_mo_pro_cost)),
            pm_bill_ann = Math.ceil(billYearly(ann_mo_pm_cost)),
            pro_save_ann = Math.ceil(saveYear(pro_cost, ann_mo_pro_cost)),
            pm_save_ann = Math.ceil(saveYear(pm_cost, ann_mo_pm_cost)),
            ann_mo_pro_cost = ann_mo_pro_cost.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,"),
            ann_mo_pm_cost = ann_mo_pm_cost.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,"),
            pro_bill_ann = pro_bill_ann.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,"),
            pm_bill_ann = pm_bill_ann.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,"),
            pro_save_ann = pro_save_ann.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,"),
            pm_save_ann = pm_save_ann.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,");
        var r = [pro_cost = pro_cost.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,"), pm_cost = pm_cost.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,"), ann_mo_pro_cost, ann_mo_pm_cost, pro_bill_ann, pm_bill_ann, pro_save_ann, pm_save_ann];
        return r
    }
    var r = [0, 0];
    return r
}
function annualBillMonthly(e) {
    return .9 * e
}
function billYearly(e) {
    return 12 * e
}
function saveYear(e, r) {
    return 12 * e - 12 * r
}
